import React, { Component } from "react";
import { Link } from "react-router-dom";

import Header from "./common/Header";
import Footer from "./common/Footer";

import ScriptTag from "react-script-tag";
import AOS from "aos";

import ImageGallery from 'react-image-gallery';

import "react-image-gallery/styles/css/image-gallery.css";

import Img1 from "./assets/images/gallery/1.jpeg";
import Img2 from "./assets/images/gallery/2.jpeg";
import Img3 from "./assets/images/gallery/3.jpeg";
import Img4 from "./assets/images/gallery/4.jpeg";
import Img5 from "./assets/images/gallery/5.jpeg";
import Img6 from "./assets/images/gallery/6.jpeg";
import Img7 from "./assets/images/gallery/7.jpeg";
import Img8 from "./assets/images/gallery/8.jpeg";
import Img9 from "./assets/images/gallery/9.jpeg";
import Img10 from "./assets/images/gallery/10.jpeg";
import Img11 from "./assets/images/gallery/11.jpeg";
import Img12 from "./assets/images/gallery/12.jpeg";
import Img13 from "./assets/images/gallery/13.jpeg";
import Img14 from "./assets/images/gallery/14.jpeg";
import Img15 from "./assets/images/gallery/15.jpeg";
import Img16 from "./assets/images/gallery/16.jpeg";

let ref_url = localStorage["refState"]
  ? JSON.parse(localStorage["refState"]).refURL
  : "";

  const images = [
    {
      original: Img1,
      thumbnail: Img1,
    },
    {
      original: Img2,
      thumbnail: Img2,
    },
    {
      original: Img3,
      thumbnail: Img3,
    },
    {
      original: Img4,
      thumbnail: Img4,
    },
    {
      original: Img5,
      thumbnail: Img5,
    },
    {
      original: Img6,
      thumbnail: Img6,
    },
    {
      original: Img7,
      thumbnail: Img7,
    },
    {
      original: Img8,
      thumbnail: Img8,
    },
    {
      original: Img9,
      thumbnail: Img9,
    },
    {
      original: Img10,
      thumbnail: Img10,
    },
    {
      original: Img11,
      thumbnail: Img11,
    },
    {
      original: Img12,
      thumbnail: Img12,
    },
    {
      original: Img13,
      thumbnail: Img13,
    },
    {
      original: Img14,
      thumbnail: Img14,
    },
    {
      original: Img15,
      thumbnail: Img15,
    },
    {
      original: Img16,
      thumbnail: Img16,
    },
  ];

// console.log(ref_url);

export default class Home extends Component {
  constructor(props) {
    super(props);
    AOS.init();
  }

  componentWillReceiveProps() {
    AOS.refresh();
  }

  render() {
    return (
      <body className="page-overview  ac-gn-current-music">
        <Header />
        <section
          id="section-quality"
          className="section section-quality"
          data-anim-scroll-group="section-quality"
          data-analytics-fallback-section-engagement="name:audio-quality"
        >
          <div
            className="copy-scroll-container"
            data-component-list="CopyMagic"
          >
            <div className="sticky-copy-lockup flex-copy-lockup intro">
              <p className="typography-section-eyebrow default-text">
                Sapio Gallery
              </p>
              <div
                className="copy-block align-text"
                data-copy="0"
                data-copy-small="0"
                data-copy-fade-at-small="75"
                data-time-offset="75"
              >
                  <ImageGallery items={images} />
            </div>
            </div>
          </div>
        </section>

        <section
          id="section-ar"
          className="section section-ar theme-dark"
          data-anim-scroll-group="section-ar"
          data-analytics-fallback-section-engagement="name:ar"
          data-analytics-section-custom="ar"
          data-analytics-section-engagement="name:ar"
        >
          <div className="section-content">
            <div className="banner-copy">
              <div className="icon-ar"></div>
              <h3
                className="typography-router-headline"
                data-aos="slide-left"
                data-aos-offset="100"
                data-aos-easing="ease-in-sine"
                data-aos-duration="500"
              >
                Become a<br />
                Member!
              </h3>
              <p
                className="typography-router-tagline ar-copy hide-on-quicklook"
                data-aos="fade-in"
                data-aos-offset="200"
                data-aos-easing="ease-in-sine"
                data-aos-duration="1000"
              >
                Join the community of Intellectuals.
              </p>
              <Link
                to="/register"
                className="ac-ln-button ar-copy hide-on-quicklook"
                data-aos="fade-in"
                data-aos-offset="200"
                data-aos-easing="ease-in-sine"
                data-aos-duration="1000"
              >
                Join Now
              </Link>
            </div>
            <figure
              className="image-ar"
              data-aos="slide-up"
              data-aos-offset="100"
              data-aos-easing="ease-in-sine"
              data-aos-duration="500"
            ></figure>
          </div>
        </section>
        {/*/main*/}
        <Footer />
        {/* Template Main JS File */}
        <ScriptTag
          type="text/javascript"
          src="../assets/js/built.js"
        />
      </body>
    );
  }
}
